INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHI', 'STOCK', 'Federated Hermes, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Federated Hermes, Inc. is an investment management company. The Company operates through a single segment, being the investment management business. It sponsors, markets, and provides investment-related services to various investment products, including sponsored investment companies and other funds (Federated Hermes Funds); and Separate Accounts, which include separately managed accounts (SMAs), institutional accounts, sub-advised funds and other managed products in both domestic and international markets. In addition, it markets and provides stewardship and real estate development services to various domestic and international companies. The Company provides investment advisory services to approximately 176 Federated Hermes Funds. It markets these funds to institutional customers and banks, broker/dealers and other financial intermediaries who use them to meet the needs of customers and/or clients, including, among others, retail investors, corporations, and retirement plans.', 'Pittsburgh, PA, United States', 2072);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRI', 'STOCK', 'Darden Restaurants, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'A Darden Restaurants, Inc. É uma empresa de restaurantes. A empresa possui e opera restaurantes de serviço completo nos Estados Unidos e Canadá sob os nomes comerciais Olive Garden, Longhorn Steakhouse, Yard House, Ruth''s Chris Steak House, Cheddar''s Scratch Kitchen, The Capital Grille, Chuy''s, Seasons 52, Eddie V''s e Bahama Breeze. Possui e opera aproximadamente 2 140 restaurantes nos Estados Unidos e no Canadá. Seus segmentos incluem Olive Garden, Longhorn Steakhouse, Fine Dining e outros negócios. O Olive Garden é um operador de restaurantes italianos de serviço completo nos Estados Unidos. O Longhorn Steakhouse é um restaurante especializado em carne bovina com serviço completo, que oferece uma variedade de itens de menu, incluindo carnes exclusivas e frango, bem como salmão, camarão e hambúrgueres. O Fine Dining inclui Chris de Ruth, o Capital Grille e Eddie V. Outros negócios incluem Cheddar''s Scratch Kitchen, Yard House, Bahama Breeze, Seasons 52 e The Capital Burger.', 'Orlando, FL, United States', 197924);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGI', 'STOCK', 'Angi Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'Angi Inc. connects home service professionals with consumers across approximately 500 different categories, from repairing and remodeling homes to cleaning and landscaping. The Companys segments include Ads and Leads, Services, Roofing, and International (includes Europe and Canada), and operates under multiple brands including Angi, HomeAdvisor, and Handy. Ads and Leads segment provides service professionals the capability to engage with potential customers, including quoting and invoicing services, and provides consumers with tools and resources to help them find local, pre-screened and customer-rated service professionals nationwide for home repair. Services segment provides a pre-priced offering service, pursuant to which consumers can request services through Angi and Handy branded platforms. Roofing segment provides roof replacement and repair services, primarily in Florida. International segment operates international businesses, such as Travaux, MyHammer and Werkspot.', 'Denver, CO, United States', 2800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMAC', 'STOCK', 'DiaMedica Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'DiaMedica Therapeutics Inc. is a clinical-stage biopharmaceutical company focused on improving the lives of people suffering from preeclampsia (PE) and acute ischemic stroke (AIS). The Companys lead candidate, DM199, is the first pharmaceutically active recombinant (synthetic) form of the KLK1 protein, an established therapeutic modality in Asia for the treatment of pre-eclampsia, acute ischemic stroke and other vascular diseases. DM199 (rinvecalinase alfa) is a recombinant form of human tissue kallikrein-1 (rhKLK1) in clinical development for preeclampsia and acute ischemic stroke. KLK1 is a serine protease enzyme that is involved in the regulation of diverse physiological processes via a molecular mechanism that increases the production of nitric oxide, prostacyclin and endothelium-derived hyperpolarizing factors. In the treatment of preeclampsia, DM199 is intended to lower blood pressure, enhance endothelial health and improve perfusion to maternal organs and the placenta.', 'Minneapolis, MN, United States', 27);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARHS', 'STOCK', 'Arhaus, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'Arhaus, Inc. is a lifestyle brand and omni-channel retailer of premium home furnishings. The Company through its proprietary model, designs and sources products from manufacturers and artisans around the world. It has approximately 100 showrooms and design center locations across the United States. It offers merchandise in various categories, including furniture, outdoor, lighting, textiles, and decor. Its furniture product offerings consist of bedroom, dining room, living room and home office furnishings and include sofas, dining tables, and chairs, among others. Its outdoor product offerings include outdoor dining tables, chairs, chaises and other furniture, lighting, and others. Its lighting product offerings consist of a variety of distinct and artistic lighting fixtures. Its textile product offerings include handcrafted indoor and outdoor rugs, bed linens, and pillows and throws. Decor ranges from wall art to mirrors, vases to candles, and many other decorative accessories.', 'Boston Heights, OH, United States', 2390);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOOT', 'STOCK', 'Boot Barn Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Boot Barn Holdings, Inc. is a lifestyle retailer of western and work-related footwear, apparel, and accessories in the United States. The Company operates through two segments: retail stores and e-commerce. The retail segment is a specialty retail store that sells western and work boots and related apparel and accessories. Its e-commerce segment sells its merchandise via the Internet. The Company carries an assortment of denim, western shirts, cowboy hats, belts and belt buckles, western-style jewelry, and accessories. The western assortment includes various brands, such as Ariat, Cinch, Cody James, Corral, Dan Post, Durango, El Dorado, Idyllwind, Justin, Laredo, Lucchese, Miss Me, Montana Silversmiths, Moonshine Spirit, Shyanne, Stetson, Tony Lama, Twisted X, Resistol and Wrangler. The work assortment includes rugged footwear, outerwear, overalls, denim, and shirts. Its other brand includes Dickies, Carhartt, Wolverine, and Hawx. It operates approximately 403 stores in 45 states.', 'Irvine, CA, United States', 3300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNR', 'STOCK', 'Core Natural Resources, Inc.', 'NYQ', 'Energy', 'Thermal Coal', 'Core Natural Resources, Inc., formerly CONSOL Energy Inc., is a producer and exporter of coals, including metallurgical and high calorific value thermal coals. The Company operates a portfolio, including the Pennsylvania Mining Complex, Leer, Leer South, and West Elk mines. It owns and oversees 11 major coal mining operations across the country, including the longwall coal mining complexes in North America. Its mining operations also include the metallurgical coal portfolios in the United States. It has ownership interests in two marine export terminals. Its product portfolio encompasses Low-Vol, High-Vol A, High Vol-B, Crossover, High Calorific Value Thermal, and PRB coals. Through ownership of two strategic export terminals on the United States Eastern Seaboard, it is an exporter of coal products serving multiple emerging seaborne markets. It mines and markets a broad assortment of carbon-based products for industrial metallurgical applications, primarily steel production.', 'Canonsburg, PA, United States', 2076);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGX', 'STOCK', 'Quest Diagnostics Incorporated', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'O Quest Diagnostics Incorporated é um fornecedor de serviços de informação de diagnóstico. A empresa fornece informações diagnósticas dos resultados de seus testes laboratoriais para permitir que pessoas, médicos e organizações tomem medidas para melhorar os resultados de saúde. Atua através do segmento DIS, que fornece serviços de informação diagnóstica a uma variedade de clientes dentro de seus principais canais de clientes: Médicos, hospitais, pacientes e consumidores. Oferece amplo acesso a testes clínicos através de uma rede nacional de laboratórios, centros de atendimento ao paciente, flebotomistas em consultórios médicos e recursos de conetividade, incluindo call centers e flebotomistas móveis, enfermeiros e outros profissionais de saúde e bem-estar. Também se concentra em soluções de inteligência artificial (IA) e patologia digital. Os serviços da Empresa são principalmente fornecidos sob a marca Quest Diagnostics e sob outras marcas, incluindo AmeriPath, Dermpath Diagnostics, ', 'Secaucus, NJ, United States', 55000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AL', 'STOCK', 'Air Lease Corporation', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Air Lease Corporation is a global aircraft leasing company. The Company is principally engaged in purchasing new commercial aircraft and leasing them to its airline customers worldwide through customized aircraft leasing and financing solutions. It purchases commercial aircraft directly from aircraft manufacturers, such as Airbus S.A.S. (Airbus) and The Boeing Company (Boeing). In addition to its leasing activities, it sells aircraft from its fleet to third parties, including other leasing companies, financial service companies, airlines and other investors. It also provides fleet management services to investors and owners of aircraft portfolios for a management fee. It has relationships with over 200 airlines across 70 countries. The Company operates its business on a global basis, providing aircraft to airline customers in every major geographical region, including markets, such as Asia Pacific, Europe, the Middle East and Africa, Central America, South America, and others.', 'Los Angeles, CA, United States', 165);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALEC', 'STOCK', 'Alector, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Alector, Inc. is a clinical-stage biotechnology company. The Company is focused on developing therapies to counteract the devastating progression of neurodegenerative diseases. It also develops alector brain carrier (ABC), a proprietary blood-brain barrier platform, which is applied to its next-generation product candidates and research pipeline. Its research and drug discovery platform leverages human genetic datasets, advanced tools in bioinformatics and imaging, and insights in neurodegeneration. Its clinical development portfolio includes latozinemab (AL001) and AL101/GSK4527226, while its preclinical and research pipeline candidates include ADP037-ABC, ADP050-ABC, ADP056, and ADP063-ABC/ADP064-ABC. Its first product candidate, latozinemab, is a human recombinant monoclonal antibody that increases the levels of progranulin (PGRN) in the brains of FTD-GRN patients. The AL101/GSK4527226, is a human recombinant monoclonal antibody designed to elevate PGRN levels in the brain.', 'South San Francisco, CA, United States', 163);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAF', 'STOCK', 'First American Financial Corporation', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'First American Financial Corporation, through its subsidiaries, is engaged in the business of providing title insurance, settlement services and other financial services and risk solutions. Its segments include Title Insurance and Services, Home Warranty, and Corporate segment. The Title Insurance and Services segment issues title insurance policies on residential and commercial property in the United States and offers similar or related products and services internationally. This segment also provides closing and/or escrow services, accommodates tax-deferred exchanges of real estate, and maintains, manages and provides access to title plant data and records. The Home Warranty segment provides residential service contracts that cover residential systems, such as heating and air conditioning systems, and certain appliances against failures that occur as the result of normal usage during the coverage period. The Corporate segment includes investments in venture-stage companies.', 'Santa Ana, CA, United States', 19038);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWEN', 'STOCK', 'Clearway Energy, Inc.', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Clearway Energy, Inc. is a renewable energy company. It invests in energy infrastructure and focuses on investments in clean energy and owns sustainable and long-term contracted assets across North America. Its portfolio comprises approximately 11.8 gigawatts (GW) of gross capacity in 26 states, including approximately 9.1 GW of wind, solar and battery energy storage systems and approximately 2.8 GW of conventional dispatchable power capacity that provide critical grid reliability services. Its operating facilities include Carlsbad, El Segundo, GenConn Devon, GenConn Middletown, Marsh Landing and Walnut Creek. Its utility-scale solar projects include Agua Caliente, Alpine, Avenal, Avra Valley, Blythe, Borrego, Buckthorn Solar, CVSR, Daggett 2, Daggett 3, Desert Sunlight 250, Kansas South, and others. Its wind projects include Black Rock, Buffalo Bear, Cedro Hill, Crofton Bluffs, Cedar Creek, and others. It also operates the 137 MW Tuolumne Wind Project in Klickitat County, Washington.', 'Princeton, NJ, United States', 60);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGY', 'STOCK', 'VAALCO Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'VAALCO Energy, Inc. is an independent energy company with a diverse portfolio of production, development and exploration assets across Gabon, Egypt, Cote dIvoire, Equatorial Guinea, Nigeria and Canada. It is engaged in the acquisition, exploration, development and production of crude oil, natural gas and natural gas liquids. It owns a working interest in, and is the operator of, the Etame PSC related to the Etame Marin block located offshore Gabon in West Africa. The Etame Marin block covers an area of about 46,200 gross acres. The Company owns an interest in an undeveloped block offshore Equatorial Guinea, West Africa. In Egypt, its interests are spread across two regions: the Eastern Desert and the Western Desert. In Harmattan, Canada, it owns production and working interests in Cardium light oil and Mannville liquids-rich gas assets. It also owns a working interest in the Block CI-40 and CI-705 block offshore Cote dIvoire in West Africa.', 'Houston, TX, United States', 230);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHTH', 'STOCK', 'eHealth, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'eHealth, Inc. is an independent licensed insurance agency and advisor. It is a private health insurance marketplace with a technology and service platform that provides consumer engagement, education and health insurance enrollment solutions. Its segments include Medicare and Employer and Individual (E&I). The Medicare segment markets Medicare-related health insurance plans and, to a lesser extent, ancillary products such as dental and vision insurance and hospital indemnity plans, to its Medicare-eligible consumers. Its Medicare ecommerce platform can be accessed through its Websites www.eHealthMedicare.com and www.GoMedigap.com, along with its telephonic enrollment capabilities. The E&I segment markets individual and family health insurance plans, along with employer plans, which include small business health insurance plans and individual coverage health reimbursement arrangements. It also markets a variety of ancillary products, including short-term, dental and vision plans.', 'Austin, TX, United States', 1773);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DC', 'STOCK', 'Dakota Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'Dakota Gold Corp. is a gold exploration and development company with a focus on revitalizing the Homestake District in Lead, South Dakota. The Company focuses on advancing the Richmond Hill Oxide Heap Leach Gold Project and outlining a high-grade underground gold resource at the Maitland Gold Project located on private land in South Dakota. The Richmond Hill Oxide Heap Leach Gold Project is located in the western portion of Lawrence County, South Dakota, United States of America. The Maitland Property covers the Homestake iron formation extending from the Blind Gold Property target at the north end to Homestake Mining Company''s North Drift gold discovery. Its other gold projects include City Creek Gold Project, Blind Gold Project, Tinton Gold Project, Cambrian Unconformity Project, West Corridor Gold Project, Ragged Top Gold Project, and South Lead / Whistler Gulch Gold Project. The City Creek project consists of a group of 333 unpatented lode-mining claims (6,161 acres).', 'Lead, SD, United States', 41);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VBTX', 'STOCK', 'Veritex Holdings, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Veritex Holdings, Inc. is a bank holding company. The Company conducts banking activities through its wholly owned subsidiary, Veritex Community Bank (the Bank), with locations throughout the Dallas-Fort Worth metroplex and in the Houston metropolitan area. The Bank provides a full range of banking services, including commercial and retail lending and checking and savings deposit products, to individual and corporate customers. It operates through the community banking segment. The Bank provides relationship-driven commercial banking products and services tailored to meet the needs of small to medium-sized businesses and professionals. The Bank offers a full suite of online banking solutions, including access to account balances, online transfers, online bill payment and electronic delivery of customer statements, as well as ATMs, and mobile and digital banking, mail and personal appointments. The Bank also offers a full array of commercial treasury management services.', 'Dallas, TX, United States', 858);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRF', 'STOCK', 'Cornerstone Total Return Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Cornerstone Total Return Fund, Inc. is a closed-ended equity mutual fund launched and managed by Cornerstone Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in value and growth stocks of companies across all market capitalizations. The fund also invests through other closed-end investment companies and ETFs. It benchmarks the performance of its portfolio against the S&P 500 Index. Cornerstone Total Return Fund, Inc. was formed on March 16, 1973 and is domiciled in the United States.', 'Asheville, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FTGC', 'STOCK', 'First Trust Global Tactical Commodity Strategy Fund', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund ("ETF") that seeks to achieve attractive risk adjusted returns by investing in commodity futures contracts, exchange-traded commodity linked instruments, and commodity linked total return swaps (collectively, "Commodities Instruments") through a wholly-owned subsidiary of the fund organized under the laws of the Cayman Islands (the "Subsidiary"). The advisor expects to gain exposure to these investments exclusively by investing in the Subsidiary.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TARS', 'STOCK', 'Tarsus Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Tarsus Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapeutics, starting with eye care. The Companys lead product candidate, XDEMVY, is a lotilaner ophthalmic solution that targets and eradicates the root cause of Demodex blepharitis, Demodex mite infestation. The active pharmaceutical ingredient (API) of XDEMVY, lotilaner, paralyzes and eradicates mites and other parasites through the inhibition of parasite-specific gamma-aminobutyric acid-gated chloride channels. The Company is investigating the development of its product candidates to address targeted diseases with high unmet medical needs, which include TP-04, a novel ophthalmic gel formulation of lotilaner for the potential treatment of Ocular Rosacea, and TP-05, a novel investigational oral formulation of lotilaner, for potential Lyme disease prophylaxis and community malaria reduction.', 'Irvine, CA, United States', 323);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('UPLD', 'STOCK', 'Upland Software, Inc.', 'NGM', 'Technology', 'Software - Application', 'Upland Software, Inc. provides artificial intelligence (AI)-powered knowledge and content management software. The Company provides cloud-based software applications. Its solutions cover knowledge management, content lifecycle and workflow automation, and digital marketing. It provides knowledge management solutions designed to help organizations capture, organize, and distribute information to employees and customers. It also offers content lifecycle and workflow automation solutions that support document management, compliance, and process efficiency across various industries. Digital marketing solutions provide tools for audience engagement, campaign management, and content distribution across digital channels. The Companys customers operate in a range of industries, including financial services, consulting services, technology, manufacturing, media, telecommunications, government, insurance, non-profit, healthcare, life sciences, legal, retail and hospitality.', 'Austin, TX, United States', 998);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNDT', 'STOCK', 'Conduent Incorporated', 'NMS', 'Technology', 'Information Technology Services', 'Conduent Incorporated is a global technology-led business process solutions and services company. The Companys Commercial segment provides business process services that span its clients business processes end-to-end from the front-office to the back-office for a variety of commercial industries. Its technology-led solutions and services include Customer Experience Management (CXM), Business Operations Solutions (BOS), Healthcare Claims and Administration Solutions and Human Capital Solutions (HCS). Its Government segment provides government-centric services and solutions to U.S. federal, state, local and foreign governments for public assistance, healthcare programs and administration, transaction processing, payment services and case management. Its Transportation segment provides systems, support and revenue-generating solutions to government transportation agency clients. It delivers mission-critical tolling, transit and digital payment solutions that streamline operations.', 'Florham Park, NJ, United States', 53000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COCO', 'STOCK', 'The Vita Coco Company, Inc.', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'The Vita Coco Company, Inc. offers a platform for brands in the functional beverage category. The Companys brands include coconut water, Vita Coco; sustainably packaged water, Ever & Ever; and protein-infused water, PWR LIFT. Its branded portfolio is led by its Vita Coco brand, which is engaged in the coconut water category in the United States, and also includes coconut oil, juice, and milk offerings. It supplies private label products to retailers in both the coconut water and coconut oil categories. Additionally, the Company is also engaged in bulk product sales to beverage and food companies. Its Americas segment comprised of its operations primarily in the United States and Canada and the International segment comprised of operations primarily in Europe, the Middle East and the Asia Pacific regions. The Companys products are distributed primarily through club, food, drug, mass, convenience, e-commerce, and foodservice channels.', 'New York, NY, United States', 319);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASH', 'STOCK', 'Ashland Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Ashland Inc. is a global additives and specialty ingredients company. The Company serves customers in a wide range of consumer and industrial markets, including architectural coatings, construction, energy, food and beverage, personal care and pharmaceuticals. The Companys segments include Life Sciences, Personal Care, Specialty Additives, and Intermediates. The Life Sciences segment consists of pharmaceuticals, nutrition, agricultural chemicals, diagnostic films and fine chemicals. The Personal Care segment includes bio functionals, microbial protectants (preservatives), skin care, sun care, oral care, hair care and household solutions. The Specialty Additives segment consists of rheology and performance-enhancing additives serving the architectural coatings, construction, energy, automotive and various industrial markets. The Intermediates segment consists of the production of 1,4 butanediol (BDO) and related derivatives, including n-methyl pyrrolidone.', 'Wilmington, DE, United States', 2960);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APGE', 'STOCK', 'Apogee Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Apogee Therapeutics, Inc. is a clinical-stage biotechnology company. The Company is advancing novel biologics with the potential for differentiated efficacy and dosing in the inflammatory and immunology (I&I) markets, including for the treatment of atopic dermatitis (AD), asthma, eosinophilic esophagitis (EoE), chronic obstructive pulmonary disease (COPD), and other I&I indications. APG777, the Companys most advanced program, is being initially developed for the treatment of AD. With four validated targets in its portfolio, it is seeking to achieve efficacy and dosing through monotherapies and combinations of its novel antibodies. Its most advanced programs are APG777, APG990, APG333, and APG808. APG990 is an SQ extended half-life mAb that utilizes advanced antibody engineering to target OX40L. APG333 is a fully human mAb against thymic stromal lymphopoietin (TSLP). APG808 is an SQ extended half-life mAb targeting IL-4R?. APG279 is for the dual inhibition of OX40L and IL-13.', 'Waltham, MA, United States', 196);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMPO', 'STOCK', 'CompoSecure, Inc.', 'NGM', 'Industrials', 'Metal Fabrication', 'CompoSecure, Inc. is a technology partner to fintechs and consumers around the globe. The Company offers metal payment cards, security, and authentication solutions. Its segments include Payment Card and Arculus. Payment Card is engaged in the production and sale of metal payment cards. Arculus is engaged in the production and sale of metal payment or nonpayment cards containing Arculus technology for authentication and/or digital asset cold storage and related services. Its metal payment cards are issued on the Visa, Mastercard, American Express, and China Union Pay payment networks. Its Arculus business solutions include Payments + Arculus Authenticate, white-labeled cold storage, Payments + Arculus Cold Storage, and Payments + Arculus Authenticate + Arculus Cold Storage. It provides white-labeled cold storage wallets in the form of premium metal cards, to give consumers the ability to make transactions and store the private keys to their digital assets in the same metal cards.', 'Somerset, NJ, United States', 1000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARS', 'STOCK', 'Cars.com Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Cars.com Inc., doing business as Cars Commerce Inc., is an audience-driven technology company. It is engaged in car buying and selling with products, solutions and machine-learning model-driven artificial intelligence technologies that span pretail, retail and post-sale activities. Cars Commerce platform is organized over four brands: the flagship automotive marketplace and dealer reputation site Cars.com, digital retail technology and marketing services from Dealer Inspire and D2C Media, essential trade-in and appraisal technology from AccuTrade, and media solutions from the Cars Commerce Media Network. It enables shoppers with the data, resources and digital tools needed to make informed buying decisions and connect with automotive retailers. Cars.com enables dealerships and original equipment manufacturers with solutions and data-driven intelligence. Its products and solutions have attracted over 19,200 franchise and independent dealer customers across the United States and Canada.', 'Chicago, IL, United States', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCK', 'STOCK', 'Crown Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'Crown Holdings, Inc. designs, manufactures and sells packaging products for consumer goods and industrial products. The Company''s segments include Americas Beverage, European Beverage, Asia Pacific, Transit Packaging and Other. The Americas Beverage segment manufactures infinitely recyclable aluminum beverage cans and ends, glass bottles, steel crowns and aluminum caps. The European Beverage segment manufactures infinitely recyclable aluminum beverage cans and ends in Europe, the Middle East and North Africa. The Asia Pacific segment consists of beverage can and non-beverage can operations, primarily food cans and specialty packaging. The Transit Packaging segment includes its worldwide automation and equipment technologies, protective packaging solutions and steel and plastic consumables. The Company''s Other segments include its food can, aerosol can and closures businesses in North America, and beverage tooling and equipment operations in the United States and the United Kingdom.', 'Tampa, FL, United States', 23000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFFN', 'STOCK', 'Capitol Federal Financial, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Capitol Federal Financial, Inc. is a unitary savings and loan holding company. The Company provides a full range of retail banking services through its subsidiary, Capitol Federal Savings Bank (the Bank), a federal savings bank, which has 44 traditional and four in-store banking offices serving primarily the metropolitan areas of Topeka, Wichita, Lawrence, Manhattan, Emporia and Salina, Kansas and portions of the Kansas City metropolitan area. The Bank attracts deposits primarily from the general public and from businesses and invests those funds primarily in permanent loans secured by first mortgages on owner-occupied, one-to four-family residences and in commercial loans. It offers an array of retail and business deposit products and services. These products include checking, savings, money market, certificates of deposit, and retirement accounts. The Banks deposit services are provided through its network of traditional branches and retail in-store locations, its call center.', 'Topeka, KS, United States', 583);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NUV', 'STOCK', 'Nuveen Municipal Value Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Nuveen Municipal Value Fund, Inc. is a closed-ended fixed income mutual fund launched by Nuveen Investments, Inc. The fund is co-managed by Nuveen Fund Advisors LLC and Nuveen Asset Management, LLC. It invests in the fixed income markets of the United States. The fund also invests some portion of its portfolio in derivative instruments. It invests in undervalued municipal securities and other related investments the income, exempt from regular federal income taxes that are rated Baa or BBB or better. It employs fundamental analysis with bottom-up stock picking approach to create its portfolio. The fund benchmarks the performance of its portfolio against the Standard & Poor''s (S&P) National Municipal Bond Index. Nuveen Municipal Value Fund, Inc. was formed on April 8, 1987 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNXC', 'STOCK', 'Concentrix Corporation', 'NMS', 'Technology', 'Information Technology Services', 'Concentrix Corporation is a global technology and services company. The Company provides end-to-end capabilities, including customer experience (CX) process optimization, technology innovation, front- and back-office automation, analytics and business transformation. Its customer lifecycle management solutions include services such as customer care, sales support and digital marketing. It also provides complementary services, including CX/user experience (UX) strategy and design, digital transformation, and voice of the customer (VOC) and analytics. Its CX/UX strategy and design solutions, including CX strategy, data-driven user design, journey mapping, and multi-platform engineering. Its digital transformation solutions include services such as robotic process automation and cognitive automation and mobile app development. ConcentrixCX, its VOC solutions platform, helps turn customer feedback into actionable insights. It operates under the trade name Concentrix + Webhelp.', 'Newark, CA, United States', 450000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRR', 'STOCK', 'First Trust RBA American Industrial RenaissanceTM ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the equity securities that comprise the index. The index is designed to measure the performance of small and mid cap U.S. companies in the industrial and community banking sectors.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BVN', 'STOCK', 'Compañía de Minas Buenaventura S.A.A.', 'NYQ', 'Basic Materials', 'Other Precious Metals & Mining', 'Compania de Minas Buenaventura SAA is a Peru-based company primarily engaged in the mining industry. The Company and its subsidiaries focus on the exploration, extraction, concentration, smelting, and commercialization of polymetallic minerals and metals. Their key product is monohydrate manganese sulphate, which is a mineral compound. The Company''s segments include: Production and sale of minerals; Construction, development and exploration of projects; Generation and transmission of energy; Insurance brokerage; Leasing of mining concessions; Investments in shares; and Industrial activities. The Company operates the Orcopampa, Uchucchacua, Julcani, and Tambomayo mines. Additionally, the Company owns interests in various mines and operates hydroelectric power plants.', 'Lima, , Peru', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXYZ', 'STOCK', 'Destiny Tech100 Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Destiny Tech100 Inc. (the Fund) is a non-diversified, closed-end management investment company. The Funds investment objective is to maximize the portfolios total return, principally by seeking capital gains on equity and equity-related investments. Under normal market conditions, the Fund will invest at least 80% of its total assets in equity and equity-linked securities of companies principally engaged in the technology sector. The Fund will invest in the equity and equity-linked securities of what it believes to be rapidly growing venture-capital-backed emerging companies, located in the United States. The Fund may also invest on an opportunistic basis in select United States publicly traded equity securities or certain non-United States companies that otherwise meet its investment criteria. It concentrates its investments in companies operating in one or more industries within the technology group of industries. Destiny Advisors LLC serves as the investment adviser to the Fund.', 'Austin, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APD', 'STOCK', 'Air Products and Chemicals, Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A Air Products and Chemicals, Inc. É uma empresa de gases industriais. A empresa está focada em atender mercados de energia, meio ambiente e emergentes. Seu negócio de base fornece gases industriais essenciais, equipamentos relacionados e experiência em aplicações para clientes em dezenas de indústrias, incluindo refino, produtos químicos, metais, eletrônicos, fabricação, e alimentos. A empresa também desenvolve, projeta, constrói, possui e opera projetos de hidrogênio limpo que apoiam a transição para energia de baixo e zero carbono nos setores de transporte pesado e industrial. Além disso, a empresa fornece turbomáquinas, sistemas de membrana e recipientes criogênicos globalmente. A Companhia tem operações em aproximadamente 50 países. Suas indústrias incluem aeroespacial, laboratórios analíticos e pesquisa/ciência, automotivo, bebidas, bioenergia, biotecnologia, cimento e cal, produtos químicos, eletrônicos, alimentos, vidro e frit, energia de hidrogênio, processamento médico, metai', 'Allentown, PA, United States', 21850);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIXD', 'STOCK', 'First Trust Smith Opportunistic Fixed Income ETF', 'NGM', NULL, NULL, 'The fund pursues its objective by investing at least 80% of its net assets (including investment borrowings) in fixed income securities. It may invest up to 35% of its net assets in corporate, non-U.S. and non-agency debt and other securities rated below investment grade by one or more nationally recognized statistical rating organization ("NRSRO"), or, if unrated, judged to be of comparable quality by the Sub-Advisor.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACRV', 'STOCK', 'Acrivon Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Acrivon Therapeutics, Inc. is a clinical-stage biopharmaceutical company developing precision oncology medicines. It uses its precision Generative Phosphoproteomics platform, Acrivon Predictive Precision Proteomics (AP3), to develop its pipeline of oncology drug candidates. Its lead candidate, ACR-368, is a selective small molecule inhibitor which targets CHK1 and CHK2 at sub single-digit nM and single-digit nM potency in intact cells, respectively, in a registrational Phase II trial across multiple solid tumor types. Using its AP3 platform, it has developed a predictive OncoSignature test for ACR-368, called ACR-368 OncoSignature, that can predict patient response to ACR-368 monotherapy and therefore improve the clinical overall response rate (ORR) and has the potential to enable drug development. Its preclinical program, ACR-2316, is advancing in investigational new drug-enabling studies. It is a novel, dual WEE1 and PKMYT1 inhibitor small molecule development candidate.', 'Watertown, MA, United States', 75);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OLED', 'STOCK', 'Universal Display Corporation', 'NMS', 'Technology', 'Electronic Components', 'A Universal Display Corporation está envolvida na pesquisa, desenvolvimento e comercialização de tecnologias e materiais orgânicos de diodos emissores de luz (OLED) para uso em aplicações de iluminação de display e de estado sólido. Os displays OLED podem ser usados no telefone celular, televisão, monitor, wearable, tablet, notebook e computador pessoal, realidade aumentada (AR), realidade virtual (VR) e mercados automotivos. Possui um portfólio de propriedade intelectual em torno de suas tecnologias e materiais PHOLED existentes para telas e produtos de iluminação, que a empresa comercializa sob a marca UniversalPHOLED. Ele licencia suas tecnologias proprietárias, incluindo a tecnologia OLED fosforescente UniversalPHOLED que pode permitir o desenvolvimento de displays energeticamente eficientes e ecológicos e iluminação de estado sólido. A empresa também desenvolve e oferece materiais UniversalPHOLED. As suas tecnologias OLED adicionais incluem FOLED Flexible OLEDs e OVJP Organic Vapo', 'Ewing, NJ, United States', 468);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCTH', 'STOCK', 'Delcath Systems, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Delcath Systems, Inc. is an interventional oncology company focused on the treatment of primary and metastatic liver cancers. The Company''s proprietary products, HEPZATO KIT (HEPZATO (melphalan) for Injection/Hepatic Delivery System) and CHEMOSAT Hepatic Delivery System for Melphalan percutaneous hepatic perfusion (PHP), are designed to administer high-dose chemotherapy to the liver while controlling systemic exposure and associated side effects during a PHP procedure. HEPZATOTM KIT is a drug/device combination product. HEPZATO KIT is comprised of the chemotherapeutic drug melphalan and the Companys proprietary Hepatic Delivery System (HDS). In Europe, the device-only configuration of the HDS is regulated as a Class III medical device and is approved for sale under the trade name CHEMOSAT Hepatic Delivery System for Melphalan. In the United States, HEPZATO is regulated as a drug by the United States Food and Drug Administration (FDA).', 'New York, NY, United States', 96);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAY', 'STOCK', 'Dayforce Inc', 'NYQ', 'Technology', 'Software - Application', 'Dayforce, Inc. is a global human capital management (HCM) software company. The Companys Dayforce, which is a flagship cloud HCM platform, provides a full suite of HCM functionality, including global human resources (HR), payroll and tax, workforce management, benefits, and talent intelligence functionality. The Company also sells Powerpay, a cloud HR and payroll solution for the Canadian small business market, through both direct sales and established partner channels. Dayforce Human Resources provides HR professionals, managers, and employees a single, complete record of all of their HR information. Dayforce Workforce Management helps organizations manage their workforces by configuring the system to meet complex employment and working time rules and policies. Dayforce Wallet is a digital payment solution that gives employees instant access to their net earnings. The Company also offer payroll and payroll-related services using legacy technology and on-premises technology.', 'Minneapolis, MN, United States', 9600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYTK', 'STOCK', 'Cytokinetics, Incorporated', 'NMS', 'Healthcare', 'Biotechnology', 'Cytokinetics, Incorporated is a late-stage, specialty cardiovascular biopharmaceutical company focused on discovering, developing and commercializing muscle biology-directed drug candidates as potential treatments for debilitating diseases in which cardiac muscle performance is compromised. The Company is engaged in the commercialization of aficamten, a cardiac myosin inhibitor, and is being evaluated in additional clinical trials enrolling patients with obstructive and non-obstructive hypertrophic cardiomyopathy. The Company is also developing omecamtiv mecarbil, a cardiac myosin activator, in patients with heart failure with severely reduced ejection fraction (HFrEF); CK-586, a cardiac myosin inhibitor for the potential treatment of heart failure with preserved ejection fraction (HFpEF) and CK-089, a fast skeletal muscle troponin activator with potential therapeutic application to a specific type of muscular dystrophy and other conditions of impaired skeletal muscle function.', 'South San Francisco, CA, United States', 498);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBNX', 'STOCK', 'Beta Bionics, Inc.', 'NGM', 'Healthcare', 'Medical Devices', 'Beta Bionics, Inc. is a commercial-stage medical device company engaged in the design, development and commercialization of various solutions to improve the health of insulin-requiring people with diabetes (PWD). The Company''s product, the iLet Bionic Pancreas (iLet), is an insulin delivery device cleared by the United States Food and Drug Administration (FDA) to utilize adaptive closed-loop algorithms to autonomously determine every insulin dose without requiring a user to count carbohydrate intake. iLet is used for the treatment of Type 1 diabetes (T1D). The Company''s solutions include iLet for Adults, iLet for Children, Bionic Circle App and iLet Simulator. The Company is in the early stages of developing an insulin pump that is designed to adhere directly to the skin and administer insulin without the need for tubing, commonly known in the diabetes industry as a patch pump. It is also in the early stages of developing a bihormonal configuration of the iLet.', 'Irvine, CA, United States', 387);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCP', 'STOCK', 'Invesco BulletShares 2025 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2025 (collectively, "2025 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRVN', 'STOCK', 'Driven Brands Holdings Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Driven Brands Holdings Inc. is an automotive services company in North America, providing a range of consumer and commercial automotive services, including paint, collision, glass, vehicle repair, oil change, maintenance and car wash. The Company''s segments include Take 5, Franchise Brands and Car Wash. The Take 5 segment is primarily composed of the Company and franchise-operated Take 5 Oil Change business. The Franchise Brands segment is primarily composed of its portfolio of franchise brands, which include CARSTAR, Meineke, Maaco and 1-800 Radiator, along with other smaller brands and services for both retail and commercial customers such as commercial fleet operators and insurance carriers. The Car Wash segment operates under the IMO brand across Europe and Australia, providing express-style conveyor car wash services to both retail and commercial customers. Its AutoGlassNow businesses provide glass replacement and calibration services to commercial, retail and insurance customers', 'Charlotte, NC, United States', 10700);\n